const sharp = require('sharp');
let fs=require('fs')
let base64Data = buffer.replace(/^data:image\/(jpg|jpeg|png|webp|gif);base64,/, "")
let b = new Buffer(base64Data, 'base64')

sharp(b).png()
.toBuffer().then(data=>{
  let png=data.toString("base64")
    fs.writeFileSync("1.txt",png)
})

